import React, { useEffect, useState } from 'react'
import './Card.css'
const Card = (props) => {
    const [text,setText] = useState("No Text Loaded")
    useEffect(()=>{
        setText(props.text)
      },[])
  return (
    <div>
        <p>{text}</p>
        <button>USE</button>
    </div>
  )
}

export default Card
